const uint8_t *get_char_ptr(char c)
{
   uint8_t index = c - 32;
   uint8_t size = pgm_read_byte(&Ubuntu10x16[index][0]);
   for(uint8_t i = 0; i < (size*2 + 1); i++)
   {
      m_char_bytes[i] = pgm_read_byte(&Ubuntu10x16[index][i]);
   } 
   return m_char_bytes;   
}
